ent_title','field_61605c5dc91b2'),(4773,2,'testimonials_content_content',''),(4774,2,'_testimonials_content_content','field_61605bf9122d9'),(4775,2,'testimonials_content',''),(4776,2,'_testimonials_content','field_61605bec122d8'),(4777,2,'testimonials_0_content','Paul and I worked alongside each other at the Dallas Mavericks overseeing partnership marketing platforms for brands seeking to align themselves with our organization. Through collaboration with our clients, we introduced first-of-its-kind organizational promotional campaigns that were recognized by the NBA as best practices. As Director of Marketing, Paul collaborated with the ticket sales department to ensure the NBA\'s longest consecutive games sellout streak.\r\n\r\nPaul\'s ability to multi-task and collaborate with internal and external stakeholders positioned the Dallas Mavericks as thought leaders and innovators in the NBA. Paul augmented these skills in subsequent roles.. He offers these same core competencies for clients seeking someone dedicated, intelligent and energetic.'),(4778,2,'_testimonials_0_content','field_5fce74d0375fd'),(4779,2,'testimonials_0_name','Jay Ory'),(4780,2,'_testimonials_0_name','field_5fce74e6375fe'),(4781,2,'testimonials_0_job_title','Advertising | Partnership Sales and Marketing | Experiential Marketing | Naming Rights | Hospitality Sales'),(4782,2,'_testimonials_0_job_title','field_5fce74ed375ff'),(4783,2,'testimonials_1_content','Just had the pleasure to work on our first project together and I can guarantee it won‚Äôt be the last. Paul is perfectly organized, takes complete reasonability and the lead on all his projects. His approach brought laughter and a friendly manner to an intense list of assets. Overall, he made us better producers with his positive influence and encouragement. A solution driven guy and wasn‚Äôt afraid of going beyond his job to make ours easier. Not only do I recommend Paul and Monroe Consulting, I look forward to the next project he brings our way and the possibilities of being able to recommend any of our clients looking for his successful services!'),(4784,2,'_testimonials_1_content','field_5fce74d0375fd'),(4785,2,'testimonials_1_name','Ron Mewis'),(4786,2,'_testimonials_1_name','field_5fce74e6375fe'),(4787,2,'testimonials_1_job_title','Radio, TV, Print, Electronic Media production for Live Tours, Record Labels, Venues & Agencies'),(4788,2,'_testimonials_1_job_title','field_5fce74ed375ff'),(4789,2,'testimonials_2_content','Paul‚Äôs knowledge of the DFW market is second to none. He is an outstanding leader, very charismatic and all of his decisions were made with the company‚Äôs success &amp; growth at the forefront. If you can get your hands on him‚Ä¶don‚Äôt think twice.'),(4790,2,'_testimonials_2_content','field_5fce74d0375fd'),(4791,2,'testimonials_2_name','Brandy Pierce'),(4792,2,'_testimonials_2_name','field_5fce74e6375fe'),(4793,2,'testimonials_2_job_title','Senior Marketing & Events Manager | Entertainment Director | Project Manager | Award-Winning Leadership | #ONO'),(4794,2,'_testimonials_2_job_title','field_5fce74ed375ff'),(4795,2,'testimonials','3'),(4796,2,'_testimonials','field_5fce74c6375fc'),(4797,219,'custom_css','.masterful-direction .overlay {\r\nbackground: rgb(24,34,54);\r\nbackground: linear-gradient(90deg, rgba(24,34,54,1) 0%, rgba(24,34,54,1) 35%, rgba(255,255,255,0) 100%);\r\n}'),(4798,219,'_custom_css','field_605cafca65108'),(4799,219,'header_content_subtitle','Taking your ideas and events to an amplified and augmented level'),(4800,219,'_header_content_subtitle','field_62bb5f955bf28'),(4801,219,'header_content',''),(4802,219,'_header_content','field_62bb5f8d5bf27'),(4803,219,'intro_content_content','<h2>THE MONROE DIFFERENCE</h2>\r\nA relationship-driven organization with over 20 years of experience in delivering on our promises. Each advancement we make prepares your company to soar to new heights.Together we keep improving.'),(4804,219,'_intro_content_content','field_62bb5fb