36.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:1536;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:224784;}s:9:\"1536x1536\";a:5:{s:4:\"file\";s:30:\"Events-Promotions-768x1536.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:1536;s:9:\"mime-type\";s:10:\"image/jpeg\";s:8:\"filesize\";i:224784;}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(6161,290,'_wp_attachment_image_alt','Events-Promotions'),(6162,86,'_thumbnail_id','290'),(6164,88,'_wp_trash_meta_status','publish'),(6165,88,'_wp_trash_meta_time','1673547917'),(6166,88,'_wp_desired_post_slug','creative-production'),(6167,68,'_wp_old_date','2022-10-06'),(6168,135,'_wp_old_date','2022-10-06'),(6169,141,'_wp_old_date','2022-10-06'),(6170,140,'_wp_old_date','2022-10-06'),(6171,139,'_wp_old_date','2022-10-06'),(6172,138,'_wp_old_date','2022-10-06'),(6173,252,'_wp_old_date','2022-10-06'),(6174,253,'_wp_old_date','2022-10-06'),(6175,254,'_wp_old_date','2022-10-06'),(6176,209,'_edit_last','1'),(6177,84,'main_image',''),(6178,84,'_main_image','field_5f7cd3479ec82'),(6179,84,'mobile_image',''),(6180,84,'_mobile_image','field_61e5b365471f1'),(6181,84,'main_title',''),(6182,84,'_main_title','field_5f7cd08153322'),(6183,84,'description','<!-- wp:paragraph -->\r\n\r\nMonroe Consulting can assist your business on the various types of Creative Content &amp; Materials that are required to effectively promote your event, product or service. This can include advertising copy, design elements such as logos and graphics, and multimedia assets like images, radio spots and videos. Ensuring that these creative needs are met is critical for any successful marketing campaign, as they help to capture the attention of potential customers and communicate the key benefits and features of the product or service being offered. Monroe Consulting can think creatively and come up with innovative ideas that will help to differentiate your brand from competitors and effectively engage with your target audience.\r\n<ul>\r\n 	<li>Creative Concepting</li>\r\n 	<li>Graphic Design</li>\r\n 	<li>Logo Design</li>\r\n 	<li>Script Writing</li>\r\n 	<li>Video and Audio Production</li>\r\n 	<li>Print Production</li>\r\n 	<li>3D Animation &amp; Motion Graphics</li>\r\n</ul>\r\n<!-- /wp:list-item -->\r\n\r\n<!-- /wp:list -->'),(6184,84,'_description','field_5f7cd08853323'),(6185,84,'background_image',''),(6186,84,'_background_image','field_5f7cd09153324'),(6187,84,'content',''),(6188,84,'_content','field_5f7cd09c53325'),(6189,86,'main_image',''),(6190,86,'_main_image','field_5f7cd3479ec82'),(6191,86,'mobile_image',''),(6192,86,'_mobile_image','field_61e5b365471f1'),(6193,86,'main_title',''),(6194,86,'_main_title','field_5f7cd08153322'),(6195,86,'description','<!-- wp:paragraph -->\r\n\r\nMonroe Consulting can create campaigns that are designed to generate buzz and excitement around your product, service, or brand. These can take many forms, such as a special event, promotional item or a marketing campaign. These tailored events and promotions can be used to attract new customers, engage with existing ones, and build loyalty. They can also be used to drive traffic to an engagement, exhibition, or other location, and to increase sales or other desired outcomes. We take pride in careful planning and execution, which can involve the use of various marketing channels and tactics, such as social media, email marketing, traditional media and public relations.\r\n<ul>\r\n 	<li>Live Events</li>\r\n 	<li>Exhibitions</li>\r\n 	<li>Concerts</li>\r\n 	<li>Trade Shows</li>\r\n 	<li>Grand Openings, Ribbon Cuttings, Premiers</li>\r\n 	<li>Artist / Talent Management</li>\r\n 	<li>Promotional Items</li>\r\n 	<li>Brand Ambassadors / Street Teams</li>\r\n 	<li>Activation / Fulfillment</li>\r\n 	<li>Product Sampling</li>\r\n 	<li>Contests and Prize Insurance</li>\r\n 	<li>Sponsorships</li>\r\n</ul>\r\n<!-- /wp:list-item -->\r\n\r\n<!-- /wp:list -->'),(6196,86,'_description','field_5f7cd08853323'),(6197,86,'background_image',''),(6198,86,'_background_image','field_5f7cd09153324'),(6199,86,'content',''),(6200,86,'_content','field_5f7cd09c53325'),(6201,82,'main_image',''),(6202,82,'_main_image','field_5f7cd3479ec82'),(6203,82,'mobile_image',''),(6204,82,'_mobile_image','field_61e5b365471f1'),(6205,82,'main_title',''),(6206,82,'_main_title','field_5f7cd08153322'),(6207,82,'description','<!-- wp:paragraph -->\r\n\r\nMedia Planning is a crucial aspect of advertising, involving the development and implementation of a comprehensive media strategy to effectively reach target audiences. Monroe Consulting offers a range of services, including media planning, media buying, barter, and posting, with an expertise in national and local TV &amp; radio broadcast, digital paid &amp; organic, out of home, print and non-traditional media.\r\n<ul>\r\n 	<li>Full-Service Media</li>\r\n 	<li>Media Strategy &amp; Planning</li>\r\n 	<li>Media Buying &amp; Posting\r\n<ul>\r\n 	<li>TV and Radio</li>\r\n 	<li>Digital (Display, Search &amp; Social)</li>\r\n 	<li>Out of Home (Billboards,Transit, Mall)</li>\r\n 	<li>Print (Local &amp; National)</li>\r\n</ul>\r\n</li>\r\n 	<li>Hispanic Marketing</li>\r\n 	<li>Non-traditional Media</li>\r\n</ul>\r\n<!-- /wp:list-item -->\r\n\r\n<!-- /wp:list -->'),(6208,82,'_description','field_5f7cd08853323'),(6209,82,'background_image',''),(6210,82,'_background_image','field_5f7cd09153324'),(6211,82,'content',''),(6212,82,'_content','field_5f7cd09c53325'),(6213,250,'_wp_trash_meta_status','publish'),(6214,250,'_wp_trash_meta_time','1673549012'),(6215,250,'_wp_desired_post_slug','projects'),(6216,292,'_edit_lock','1673549077:1'),(6217,292,'_thumbnail_id','147'),(6218,292,'_edit_last','1'),(